import { Component } from "react";

export default class LoggingOut extends Component {
  constructor() {
    this.state = {
      redirect: false,
    };
  }
  render() {
    return (
      <div>
        <h1>
          Are you sure you want to log out ?
          <button onClick={this.leave}>yes</button>
          <button onClick={this.stay}>no</button>
        </h1>
      </div>
    );
  }
}
